package pruebagib;

public class pruebagib {
	
	public static int suma() {
		int resultado=0;
		resultado=5+5;
		return resultado;
	}
	public static int resta() {
		int resultado=0;
		resultado=10-5;
		return resultado;
	}
	

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		System.out.println(suma());
		System.out.println(resta());
	}

}
